    no expenditure was for a public communication or voter drive activity containing
    express advocacy or that referred to a clearly identified candidate for Federal
    office and that promoted, supported, attacked or opposed any such candidate for
    Federal office. The payments disclosed on Schedule B for Line 21(b) for fundraising
    activities did not constitute public communications that referred to a clearly
    identified candidate for Federal office and that promoted, supported, attacked
    or opposed any such candidate for Federal office. While these disbursements were
    eligible for allocation using the funds-received method, the Committee elected
    to pay these expenses with 100% federal funds. Payments for salaries and related
    fringe benefits disclosed on Schedule H4 are for employees who spent less than
    25% of their time engaged in activities in connection to any federal election.
    Salaries for employees who spent more than 25% of their compensated time engaged
    in activities in connection with a federal election are disclosed on Schedule
    B supporting Line 30(b).  Upon review the committee finds that taxes and fringe
    benefits relating to those salaries totaling $3,593.24 during the reporting period
    were incorrectly treated as joint activity. Those transactions are reclassified
    on this report as Federal Election Activity paid entirely with federal funds.
    A correcting transfer for $2,838.66 representing the non-federal portion will
    be made on September 1, 2010 and be reported on the October monthly report.\n"
